import React, { useContext, useEffect } from "react";
import styles from './Header.module.scss'
import { Name } from "./Name";
import { HeaderButton } from "./HeaderButton";
import { Context1, Context2, Context3, Context4, Context5 } from "../Page";

const Header = () => {
    const elem1 = useContext(Context1)
    const elem2 = useContext(Context2)
    const elem3 = useContext(Context3)
    const elem4 = useContext(Context4)
    const elem5 = useContext(Context5)

    return (
        <div className={styles.Header}>
            <Name />
            <div className={styles.Header__ButtonsBlock}>
                <HeaderButton elem={elem1}  text="About us" />
                <HeaderButton elem={elem2}  text="Course" />
                <HeaderButton elem={elem3}  text="Pricing plans" />
                <HeaderButton elem={elem4}  text="Feedbacks" />
                <HeaderButton elem={elem5}  text="Contact us" />
            </div>
        </div>
    )
}

export {Header}
